INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 70, "", 12, 0, 0, 80001, 1, "アヤネ", 0, 0, 102301);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 71, "", 12, 0, 0, 80001, 2, "アヤネ", 0, 0, 102301);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 72, "", 12, 0, 0, 80001, 1, "チカ", 1, 0, 104201);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("私のことを見守ってください\nできることなら、ずっと…", 73, "", 12, 0, 0, 80001, 2, "チカ", 1, 0, 104201);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 74, "", 12, 0, 0, 80001, 1, "クルミ", 2, 0, 102101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("で、でもこれからもずっと…\n一緒にいたいなぁ…", 75, "", 12, 0, 0, 80001, 2, "クルミ", 2, 0, 102101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 76, "", 13, 0, 0, 80001, 1, "シズル", 0, 0, 104901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 77, "", 13, 0, 0, 80001, 2, "シズル", 0, 0, 104901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 78, "", 13, 0, 0, 80001, 1, "リノ", 1, 0, 101101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 79, "", 13, 0, 0, 80001, 2, "リノ", 1, 0, 101101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 80, "", 14, 0, 0, 80001, 1, "ユイ", 0, 0, 100201);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 81, "", 14, 0, 0, 80001, 2, "ユイ", 0, 0, 100201);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("騎士くんと出会って、まだ1年しか\nたってないんだ！？", 82, "", 14, 0, 0, 80001, 1, "ヒヨリ", 1, 0, 100101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 83, "", 14, 0, 0, 80001, 2, "ヒヨリ", 1, 0, 100101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 84, "", 14, 0, 0, 80001, 1, "レイ", 2, 0, 100301);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キミに背中を預けられる日が、\n早くきますように", 85, "", 14, 0, 0, 80001, 2, "レイ", 2, 0, 100301);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 86, "", 15, 0, 0, 80001, 1, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("これからもずっと、覚えていて\nくださいね！", 87, "", 15, 0, 0, 80001, 2, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 88, "", 15, 0, 0, 80001, 1, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 89, "", 15, 0, 0, 80001, 2, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 90, "", 15, 0, 0, 80001, 1, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 91, "", 15, 0, 0, 80001, 2, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 92, "", 0, 0, 1, 60001, 1, "スズメ", 1, 0, 112101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 93, "", 0, 0, 1, 60001, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 94, "", 0, 0, 1, 60001, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 95, "", 0, 0, 1, 60001, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 96, "", 0, 0, 1, 60001, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 97, "", 0, 0, 2, 60001, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 98, "", 0, 0, 1, 60001, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 99, "", 0, 0, 1, 60001, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 100, "", 0, 0, 1, 60001, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 101, "", 0, 0, 1, 60001, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 102, "", 0, 0, 2, 60001, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 103, "", 0, 0, 1, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 104, "", 0, 0, 1, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 105, "", 0, 0, 1, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 106, "", 0, 0, 1, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 107, "", 0, 0, 1, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 108, "", 0, 0, 1, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 109, "", 0, 0, 2, 60001, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 110, "", 0, 0, 1, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 111, "", 0, 0, 1, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 112, "", 0, 0, 1, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 113, "", 0, 0, 1, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 114, "", 0, 0, 1, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 115, "", 0, 0, 1, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 116, "", 0, 0, 2, 60001, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 117, "", 0, 0, 0, 60001, 2, "スズメ", 3, 0, 112101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 118, "", 7, 0, 0, 60001, 3, "スズメ", 3, 0, 112101);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ヒューヒュー♪\nドンドンパフパフー♪", 119, "", 1, 0, 0, 80003, 1, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ひゅーひゅー\nどんどんぱふぱふー\nでございます", 120, "", 1, 0, 0, 80003, 1, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 121, "", 1, 0, 0, 80003, 2, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("え？　ちょっと\nいきなりなにっ？", 122, "", 1, 0, 0, 80003, 1, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 123, "", 1, 0, 0, 80003, 2, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 124, "", 1, 0, 0, 80003, 2, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 125, "", 1, 0, 0, 80003, 3, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ですからその日に向けて\n今から気分を盛り上げているのです", 126, "", 1, 0, 0, 80003, 3, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 127, "", 1, 0, 0, 80003, 3, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 128, "", 1, 0, 0, 80003, 4, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 129, "", 1, 0, 0, 80003, 4, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 130, "", 1, 0, 0, 80003, 4, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 131, "", 1, 0, 0, 80003, 5, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 132, "", 2, 0, 0, 80003, 5, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 133, "", 2, 0, 0, 80003, 1, "カリン", 1, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("げっ…カリンじゃない\nなんでもないわよ！", 134, "", 2, 0, 0, 80003, 6, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 135, "", 2, 0, 0, 80003, 2, "カリン", 1, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 136, "", 2, 0, 0, 80003, 7, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 137, "", 2, 0, 0, 80003, 3, "カリン", 1, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 138, "", 2, 0, 0, 80003, 8, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 139, "", 2, 0, 0, 80003, 9, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 140, "", 2, 0, 0, 80003, 4, "カリン", 1, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 141, "", 2, 0, 0, 80003, 10, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 142, "", 2, 0, 0, 80003, 5, "カリン", 1, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 143, "", 2, 0, 0, 80003, 11, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 144, "", 3, 0, 0, 80003, 6, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 145, "", 3, 0, 0, 80003, 5, "ペコリーヌ", 1, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 146, "", 3, 0, 0, 80003, 7, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 147, "", 3, 0, 0, 80003, 8, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 148, "", 3, 0, 0, 80003, 6, "ペコリーヌ", 1, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 149, "", 3, 0, 0, 80003, 7, "ペコリーヌ", 1, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あとは、牧場に素敵な温泉が\n出来たとか…", 150, "", 3, 0, 0, 80003, 9, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 151, "", 3, 0, 0, 80003, 8, "ペコリーヌ", 1, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 152, "", 3, 0, 0, 80003, 10, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えへへ、ありがとうございます\nコッコロちゃん！", 153, "", 3, 0, 0, 80003, 9, "ペコリーヌ", 1, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 154, "", 3, 0, 0, 80003, 11, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 155, "", 3, 0, 0, 80003, 10, "ペコリーヌ", 1, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 156, "", 4, 0, 0, 80003, 11, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 157, "", 4, 0, 0, 80003, 12, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 158, "", 4, 0, 0, 80003, 12, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 159, "", 4, 0, 0, 80003, 13, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 160, "", 4, 0, 0, 80003, 13, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…積極的？\nなんの話よ？", 161, "", 4, 0, 0, 80003, 14, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 162, "", 4, 0, 0, 80003, 14, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ムーサの町で\nきゃるきゃる～ん☆　って！", 163, "", 4, 0, 0, 80003, 15, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 164, "", 4, 0, 0, 80003, 15, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 165, "", 4, 0, 0, 80003, 16, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 166, "", 4, 0, 0, 80003, 16, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 167, "", 4, 0, 0, 80003, 17, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 168, "", 5, 0, 0, 80003, 18, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 169, "", 5, 0, 0, 80003, 12, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 170, "", 5, 0, 0, 80003, 19, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 171, "", 5, 0, 0, 80003, 13, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 172, "", 5, 0, 0, 80003, 20, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 173, "", 5, 0, 0, 80003, 14, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 174, "", 5, 0, 0, 80003, 21, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 175, "", 5, 0, 0, 80003, 15, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("かくし芸？", 176, "", 5, 0, 0, 80003, 22, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 177, "", 5, 0, 0, 80003, 16, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 178, "", 5, 0, 0, 80003, 23, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 179, "", 6, 0, 0, 80003, 17, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 180, "", 6, 0, 0, 80003, 24, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 181, "", 6, 0, 0, 80003, 17, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 182, "", 6, 0, 0, 80003, 18, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 183, "", 6, 0, 0, 80003, 25, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 184, "", 6, 0, 0, 80003, 18, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 185, "", 6, 0, 0, 80003, 26, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 186, "", 6, 0, 0, 80003, 27, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 187, "", 6, 0, 0, 80003, 28, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 188, "", 6, 0, 0, 80003, 19, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 189, "", 6, 0, 0, 80003, 19, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 190, "", 6, 0, 0, 80003, 29, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 191, "", 7, 0, 0, 80003, 30, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 192, "", 7, 0, 0, 80003, 31, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 193, "", 7, 0, 0, 80003, 32, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あー\nあー\n…声、これで大丈夫かしら？", 194, "", 7, 0, 0, 80003, 33, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 195, "", 7, 0, 0, 80003, 34, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("オイッスー☆", 196, "", 7, 0, 0, 80003, 35, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("……\nいや、ないわ\nいつもどおりが一番ね、うん", 197, "", 7, 0, 0, 80003, 36, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 198, "", 7, 0, 0, 80003, 37, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ど、どど、どうしよう！？\n緊張してきちゃった…！！", 199, "", 7, 0, 0, 80003, 38, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 200, "", 8, 0, 0, 80003, 20, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 201, "", 8, 0, 0, 80003, 21, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 202, "", 8, 0, 0, 80003, 22, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 203, "", 8, 0, 0, 80003, 23, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 204, "", 8, 0, 0, 80003, 24, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("オイッスー☆", 205, "", 8, 0, 0, 80003, 25, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 206, "", 8, 0, 0, 80003, 26, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 207, "", 8, 0, 0, 80003, 27, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 208, "", 8, 0, 0, 80003, 28, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("オイッスー☆", 209, "", 9, 0, 0, 80003, 20, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 210, "", 9, 0, 0, 80003, 21, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あと６日で2.5周年ですか…", 211, "", 9, 0, 0, 80003, 22, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 212, "", 9, 0, 0, 80003, 23, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 213, "", 9, 0, 0, 80003, 24, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("オイッスー☆", 214, "", 9, 0, 0, 80003, 25, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 215, "", 9, 0, 0, 80003, 26, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 216, "", 9, 0, 0, 80003, 27, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 217, "", 9, 0, 0, 80003, 28, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 218, "", 9, 0, 0, 80003, 29, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 219, "", 9, 0, 0, 80003, 30, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 220, "", 10, 0, 0, 80003, 31, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 221, "", 10, 0, 0, 80003, 29, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 222, "", 10, 0, 0, 80003, 32, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…………", 223, "", 10, 0, 0, 80003, 39, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 224, "", 10, 0, 0, 80003, 30, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 225, "", 10, 0, 0, 80003, 40, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 226, "", 10, 0, 0, 80003, 33, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 227, "", 10, 0, 0, 80003, 41, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 228, "", 10, 0, 0, 80003, 34, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 229, "", 10, 0, 0, 80003, 35, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 230, "", 10, 0, 0, 80003, 42, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 231, "", 10, 0, 0, 80003, 31, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 232, "", 10, 0, 0, 80003, 43, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 233, "", 10, 0, 0, 80003, 36, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 234, "", 11, 0, 0, 80003, 6, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 235, "", 11, 0, 0, 80003, 7, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 236, "", 11, 0, 0, 80003, 8, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 237, "", 11, 0, 0, 80003, 9, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 238, "", 11, 0, 0, 80003, 10, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("次にコッコロさんですが\nこちらは発声練習をしています", 239, "", 11, 0, 0, 80003, 11, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 240, "", 11, 0, 0, 80003, 12, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 241, "", 11, 0, 0, 80003, 13, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あれ？\nもしかして緊張で気を失って…？", 242, "", 11, 0, 0, 80003, 14, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 243, "", 11, 0, 0, 80003, 15, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 244, "", 11, 0, 0, 80003, 16, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それでは\nまた明日お会いしましょう♪", 245, "", 11, 0, 0, 80003, 17, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 246, "", 12, 0, 0, 80003, 44, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 247, "", 12, 0, 0, 80003, 37, "ペコリーヌ", 2, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 248, "", 12, 0, 0, 80003, 32, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 249, "", 12, 0, 0, 80003, 45, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ひどいですよぉキャルちゃ～ん！", 250, "", 12, 0, 0, 80003, 38, "ペコリーヌ", 2, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 251, "", 12, 0, 0, 80003, 33, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 252, "", 12, 0, 0, 80003, 39, "ペコリーヌ", 2, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 253, "", 12, 0, 0, 80003, 46, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 254, "", 12, 0, 0, 80003, 34, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 255, "", 12, 0, 0, 80003, 40, "ペコリーヌ", 2, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 256, "", 13, 0, 0, 80003, 41, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 257, "", 13, 0, 0, 80003, 47, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("忘れてきちゃいました☆", 258, "", 13, 0, 0, 80003, 42, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 259, "", 13, 0, 0, 80003, 48, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 260, "", 13, 0, 0, 80003, 35, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 261, "", 13, 0, 0, 80003, 49, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 262, "", 13, 0, 0, 80003, 43, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 263, "", 13, 0, 0, 80003, 50, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 264, "", 13, 0, 0, 80003, 36, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 265, "", 13, 0, 0, 80003, 51, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 266, "", 13, 0, 0, 80003, 37, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 267, "", 13, 0, 0, 80003, 52, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 268, "", 13, 0, 0, 80003, 44, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 269, "", 13, 0, 0, 80003, 38, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 270, "", 13, 0, 0, 80003, 45, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 271, "", 13, 0, 0, 80003, 53, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 272, "", 13, 0, 0, 80003, 46, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("こんにちは\n【ギルド管理協会】のカリンです", 273, "", 14, 0, 0, 80003, 18, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("昨日の生放送は\nいかがだったでしょうか？", 274, "", 14, 0, 0, 80003, 19, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 275, "", 14, 0, 0, 80003, 20, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 276, "", 14, 0, 0, 80003, 21, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 277, "", 14, 0, 0, 80003, 22, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 278, "", 14, 0, 0, 80003, 23, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 279, "", 14, 0, 0, 80003, 24, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 280, "", 14, 0, 0, 80003, 25, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 281, "", 14, 0, 0, 80003, 26, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 282, "", 14, 0, 0, 80003, 27, "カリン", 0, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("準備はいいですかっ？\n…いっきますよー！", 283, "", 15, 0, 0, 80003, 47, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("祝！", 284, "", 15, 0, 0, 80003, 54, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("2.5周年！", 285, "", 15, 0, 0, 80003, 39, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おめでとうございま～す☆", 286, "", 15, 0, 0, 80003, 48, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 287, "", 15, 0, 0, 80003, 55, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 288, "", 15, 0, 0, 80003, 40, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 289, "", 15, 0, 0, 80003, 49, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 290, "", 15, 0, 0, 80003, 56, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 291, "", 15, 0, 0, 80003, 41, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 292, "", 15, 0, 0, 80003, 57, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 293, "", 15, 0, 0, 80003, 50, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 294, "", 15, 0, 0, 80003, 58, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("記念日だから\n平気平気♪\nやばいですね☆", 295, "", 15, 0, 0, 80003, 51, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("意味分かんないわよ！", 296, "", 15, 0, 0, 80003, 59, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 297, "", 15, 0, 0, 80003, 42, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 298, "", 15, 0, 0, 80003, 43, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 299, "", 15, 0, 0, 80003, 52, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 300, "", 15, 0, 0, 80003, 60, "キャル", 2, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 301, "", 15, 0, 0, 80003, 44, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 302, "", 15, 0, 0, 80003, 53, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("2.5周年\nありがとうございます！", 303, "105901,45,106001,61", 15, 1, 0, 80003, 54, "ペコリーヌ・コッコロ・キャル", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 304, "", 0, 0, 1, 60002, 1, "カリン", 1, 0, 190804);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 305, "", 0, 0, 1, 60002, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 306, "", 0, 0, 1, 60002, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 307, "", 0, 0, 1, 60002, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 308, "", 0, 0, 1, 60002, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 309, "", 0, 0, 2, 60002, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 310, "", 0, 0, 1, 60002, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 311, "", 0, 0, 1, 60002, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 312, "", 0, 0, 1, 60002, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 313, "", 0, 0, 1, 60002, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 314, "", 0, 0, 2, 60002, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 315, "", 0, 0, 1, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 316, "", 0, 0, 1, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 317, "", 0, 0, 1, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 318, "", 0, 0, 1, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 319, "", 0, 0, 1, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 320, "", 0, 0, 1, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 321, "", 0, 0, 2, 60002, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 322, "", 0, 0, 1, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 323, "", 0, 0, 1, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 324, "", 0, 0, 1, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 325, "", 0, 0, 1, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 326, "", 0, 0, 1, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 327, "", 0, 0, 1, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 328, "", 0, 0, 2, 60002, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 329, "", 0, 0, 0, 60002, 2, "カリン", 3, 0, 190804);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 330, "", 7, 0, 0, 60002, 3, "カリン", 3, 0, 190804);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ささ、シェフィさまはこちらへ…", 331, "", 1, 0, 0, 80005, 1, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("コッコロさん、どこへ行くの…？\n…え？", 332, "", 1, 0, 0, 80005, 1, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 333, "", 1, 0, 0, 80005, 1, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 334, "", 1, 0, 0, 80005, 2, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ええと…\n二人とも何をしているの？", 335, "", 1, 0, 0, 80005, 2, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 336, "", 1, 0, 0, 80005, 1, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あの日…？", 337, "", 1, 0, 0, 80005, 3, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 338, "", 1, 0, 0, 80005, 2, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("『プリンセスコネクト！\nRe:Dive』3.5周年！", 339, "", 1, 0, 0, 80005, 3, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("やばいですね☆", 340, "", 1, 0, 0, 80005, 1, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("って、なにしれっと\n参加してんのよカリン！", 341, "", 1, 0, 0, 80005, 2, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 342, "", 1, 0, 0, 80005, 2, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 343, "", 1, 0, 0, 80005, 3, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 344, "", 1, 0, 0, 80005, 4, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっ！？　ええとええと…！\nあ、あと14日…！", 345, "", 1, 0, 0, 80005, 4, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 346, "", 2, 0, 0, 80005, 5, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 347, "", 2, 0, 0, 80005, 3, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 348, "", 2, 0, 0, 80005, 4, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 349, "", 2, 0, 0, 80005, 6, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("さすがでございます\nペコリーヌさま", 350, "", 2, 0, 0, 80005, 5, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 351, "", 2, 0, 0, 80005, 3, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("しゃなり、しゃなり…\nふふ、案外できるものね", 352, "", 2, 0, 0, 80005, 5, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 353, "", 2, 0, 0, 80005, 7, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("さ、次はキャルさまの\n番でございますよ", 354, "", 2, 0, 0, 80005, 6, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あ、あたしはいいわよ！\nそういうの全然分かんないし…", 355, "", 2, 0, 0, 80005, 4, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 356, "", 2, 0, 0, 80005, 6, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 357, "", 2, 0, 0, 80005, 5, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("いたたた…もぉお～！\nなんであたしがこんな目に～！", 358, "", 2, 0, 0, 80005, 6, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 359, "", 2, 0, 0, 80005, 7, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 360, "", 2, 0, 0, 80005, 7, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 361, "", 3, 0, 0, 80005, 8, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 362, "", 3, 0, 0, 80005, 8, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 363, "", 3, 0, 0, 80005, 9, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("聖学祭…って、なにかしら？", 364, "", 3, 0, 0, 80005, 7, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 365, "", 3, 0, 0, 80005, 10, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 366, "", 3, 0, 0, 80005, 8, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 367, "", 3, 0, 0, 80005, 9, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 368, "", 3, 0, 0, 80005, 9, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("いや、そのまんますぎでしょ…", 369, "", 3, 0, 0, 80005, 10, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 370, "", 3, 0, 0, 80005, 8, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 371, "", 3, 0, 0, 80005, 10, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっ？　ええ…\nぎゅーっ…？", 372, "", 3, 0, 0, 80005, 9, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 373, "", 4, 0, 0, 80005, 11, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 374, "", 4, 0, 0, 80005, 10, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 375, "", 4, 0, 0, 80005, 12, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 376, "", 4, 0, 0, 80005, 11, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 377, "", 4, 0, 0, 80005, 13, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 378, "", 4, 0, 0, 80005, 11, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 379, "", 4, 0, 0, 80005, 14, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 380, "", 4, 0, 0, 80005, 15, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 381, "", 4, 0, 0, 80005, 11, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 382, "", 4, 0, 0, 80005, 12, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 383, "", 4, 0, 0, 80005, 12, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 384, "", 4, 0, 0, 80005, 16, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 385, "", 4, 0, 0, 80005, 12, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 386, "", 5, 0, 0, 80005, 13, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 387, "", 5, 0, 0, 80005, 14, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 388, "", 5, 0, 0, 80005, 15, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 389, "", 5, 0, 0, 80005, 17, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 390, "", 5, 0, 0, 80005, 18, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 391, "", 5, 0, 0, 80005, 13, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 392, "", 5, 0, 0, 80005, 13, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 393, "", 5, 0, 0, 80005, 16, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 394, "", 5, 0, 0, 80005, 19, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 395, "", 5, 0, 0, 80005, 17, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 396, "", 5, 0, 0, 80005, 18, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 397, "", 5, 0, 0, 80005, 19, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 398, "", 6, 0, 0, 80005, 4, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 399, "", 6, 0, 0, 80005, 5, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…えっ！？", 400, "", 6, 0, 0, 80005, 20, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 401, "", 6, 0, 0, 80005, 20, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 402, "", 6, 0, 0, 80005, 14, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 403, "", 6, 0, 0, 80005, 14, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 404, "", 6, 0, 0, 80005, 15, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 405, "", 6, 0, 0, 80005, 21, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 406, "", 6, 0, 0, 80005, 21, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ぶっ殺すぞ！？", 407, "", 6, 0, 0, 80005, 22, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 408, "", 6, 0, 0, 80005, 6, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 409, "", 7, 0, 0, 80005, 15, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 410, "", 7, 0, 0, 80005, 23, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 411, "", 7, 0, 0, 80005, 16, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 412, "", 7, 0, 0, 80005, 22, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 413, "", 7, 0, 0, 80005, 24, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 414, "", 7, 0, 0, 80005, 17, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 415, "", 7, 0, 0, 80005, 16, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 416, "", 7, 0, 0, 80005, 18, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("もちろんでございます\n仲良くお勉強いたしましょう", 417, "", 7, 0, 0, 80005, 17, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("しれっと教育ママが\n生まれてる…？", 418, "", 7, 0, 0, 80005, 25, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 419, "", 7, 0, 0, 80005, 23, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("え～～～～！？", 420, "", 7, 0, 0, 80005, 26, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 421, "", 8, 0, 0, 80005, 27, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…\nねぇコッコロさん\nキャル、どうしちゃったの？", 422, "", 8, 0, 0, 80005, 19, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 423, "", 8, 0, 0, 80005, 18, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 424, "", 8, 0, 0, 80005, 24, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 425, "", 8, 0, 0, 80005, 20, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 426, "", 8, 0, 0, 80005, 28, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 427, "", 8, 0, 0, 80005, 19, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 428, "", 8, 0, 0, 80005, 21, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 429, "", 8, 0, 0, 80005, 29, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 430, "", 8, 0, 0, 80005, 30, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 431, "", 8, 0, 0, 80005, 25, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 432, "", 8, 0, 0, 80005, 31, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 433, "", 9, 0, 0, 80005, 22, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…えっ？\n生放送の意気込み！？\n突然なに！？", 434, "", 9, 0, 0, 80005, 23, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 435, "", 9, 0, 0, 80005, 24, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 436, "", 9, 0, 0, 80005, 25, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("とにかく落ち着いて\nスタッフさんの指示を聞いて…", 437, "", 9, 0, 0, 80005, 26, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それから、それから…！\nぅ、ぅぅっ…！", 438, "", 9, 0, 0, 80005, 27, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("―びえぇぇ～んっ！！！", 439, "", 9, 0, 0, 80005, 28, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("どうされましたか、シェフィさま", 440, "", 9, 0, 0, 80005, 20, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ううっ…ひっく…\nママッ…！", 441, "", 9, 0, 0, 80005, 29, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 442, "", 9, 0, 0, 80005, 21, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 443, "", 9, 0, 0, 80005, 22, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 444, "", 9, 0, 0, 80005, 30, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("主さま\n3.5周年まであと５日\nでございます", 445, "", 10, 0, 0, 80005, 23, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ですがその前に\n生放送がありますね", 446, "", 10, 0, 0, 80005, 24, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…生放送に向けた\n意気込みでございますか？", 447, "", 10, 0, 0, 80005, 25, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 448, "", 10, 0, 0, 80005, 26, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 449, "", 10, 0, 0, 80005, 27, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 450, "", 10, 0, 0, 80005, 28, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 451, "", 10, 0, 0, 80005, 29, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 452, "", 10, 0, 0, 80005, 30, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 453, "", 10, 0, 0, 80005, 31, "コッコロ", 0, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと４日！\nやばいですね☆", 454, "", 11, 0, 0, 80005, 26, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 455, "", 11, 0, 0, 80005, 32, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 456, "", 11, 0, 0, 80005, 27, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 457, "", 11, 0, 0, 80005, 28, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 458, "", 11, 0, 0, 80005, 29, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 459, "", 11, 0, 0, 80005, 33, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 460, "", 11, 0, 0, 80005, 30, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 461, "", 11, 0, 0, 80005, 31, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 462, "", 11, 0, 0, 80005, 32, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("だからあたしはやるなんて一言も…", 463, "", 11, 0, 0, 80005, 34, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("オイッスー☆", 464, "", 11, 0, 0, 80005, 33, "ペコリーヌ", 0, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("聞きなさいっての！！", 465, "", 11, 0, 0, 80005, 35, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと３日…\nそして生放送は、明日…", 466, "", 12, 0, 0, 80005, 31, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 467, "", 12, 0, 0, 80005, 32, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おいっす！\n…こうじゃなかったわね\nええと確か…", 468, "", 12, 0, 0, 80005, 33, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 469, "", 12, 0, 0, 80005, 34, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 470, "", 12, 0, 0, 80005, 35, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("やってますねシェフィちゃん！", 471, "", 12, 0, 0, 80005, 34, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なによ、考えることは\nみんな同じってこと？", 472, "", 12, 0, 0, 80005, 36, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 473, "", 12, 0, 0, 80005, 32, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("みんな…もちろんよ！", 474, "", 12, 0, 0, 80005, 36, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 475, "", 12, 0, 0, 80005, 35, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 476, "", 13, 0, 0, 80005, 7, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 477, "", 13, 0, 0, 80005, 8, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 478, "", 13, 0, 0, 80005, 36, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 479, "", 13, 0, 0, 80005, 9, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 480, "", 13, 0, 0, 80005, 33, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("さすが【美食殿】のママですね！\nそしてキャルさんは…", 481, "", 13, 0, 0, 80005, 10, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("大丈夫…大丈夫…\nあたしは大丈夫…", 482, "", 13, 0, 0, 80005, 37, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 483, "", 13, 0, 0, 80005, 11, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あうー？", 484, "", 13, 0, 0, 80005, 37, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("あ…", 485, "105901,34,106001,38,190801,12", 13, 1, 0, 80005, 37, "みんな", 4, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 486, "", 13, 0, 0, 80005, 39, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 487, "", 13, 0, 0, 80005, 35, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 488, "", 13, 0, 0, 80005, 38, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 489, "", 13, 0, 0, 80005, 13, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 490, "", 14, 0, 0, 80005, 38, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 491, "", 14, 0, 0, 80005, 39, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 492, "", 14, 0, 0, 80005, 40, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 493, "", 14, 0, 0, 80005, 36, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 494, "", 14, 0, 0, 80005, 39, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 495, "", 14, 0, 0, 80005, 40, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 496, "", 14, 0, 0, 80005, 37, "コッコロ", 1, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 497, "", 14, 0, 0, 80005, 41, "キャル", 0, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("へ、へぇ…", 498, "", 14, 0, 0, 80005, 40, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 499, "", 14, 0, 0, 80005, 41, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 500, "", 14, 0, 0, 80005, 41, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 501, "", 14, 0, 0, 80005, 42, "シェフィ", 2, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 502, "", 15, 0, 0, 80005, 42, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("祝！", 503, "", 15, 0, 0, 80005, 42, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("3.5周年！", 504, "", 15, 0, 0, 80005, 38, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("おめでとうございます！", 505, "", 15, 0, 0, 80005, 43, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 506, "", 15, 0, 0, 80005, 14, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 507, "", 15, 0, 0, 80005, 15, "カリン", 2, 0, 190801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 508, "", 15, 0, 0, 80005, 43, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 509, "", 15, 0, 0, 80005, 44, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 510, "", 15, 0, 0, 80005, 43, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 511, "", 15, 0, 0, 80005, 44, "キャル", 1, 0, 106001);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 512, "", 15, 0, 0, 80005, 44, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 513, "", 15, 0, 0, 80005, 45, "シェフィ", 0, 0, 106401);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 514, "", 15, 0, 0, 80005, 39, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 515, "", 15, 0, 0, 80005, 40, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 516, "", 15, 0, 0, 80005, 41, "コッコロ", 4, 0, 105901);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 517, "", 15, 0, 0, 80005, 45, "ペコリーヌ", 3, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("これからも\nよろしくおねがいします！", 518, "105901,42,106001,45,106401,46,190801,16", 15, 1, 0, 80005, 46, "みんな", 4, 0, 105801);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 519, "", 0, 0, 1, 60003, 1, "カリン", 1, 0, 190804);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 520, "", 0, 0, 1, 60003, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 521, "", 0, 0, 1, 60003, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 522, "", 0, 0, 1, 60003, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 523, "", 0, 0, 1, 60003, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 524, "", 0, 0, 2, 60003, 0, "", 2, 1, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 525, "", 0, 0, 1, 60003, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 526, "", 0, 0, 1, 60003, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 527, "", 0, 0, 1, 60003, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 528, "", 0, 0, 1, 60003, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 529, "", 0, 0, 2, 60003, 0, "", 2, 2, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 530, "", 0, 0, 1, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 531, "", 0, 0, 1, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 532, "", 0, 0, 1, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 533, "", 0, 0, 1, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 534, "", 0, 0, 1, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 535, "", 0, 0, 1, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 536, "", 0, 0, 2, 60003, 0, "", 2, 3, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 537, "", 0, 0, 1, 60003, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 538, "", 0, 0, 1, 60003, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 539, "", 0, 0, 1, 60003, 0, "", 2, 4, 0);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES ("今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 540, "", 0, 0, 1, 60003, 0, "", 2, 4, 0);
